margin: 40px;
padding: 80px;
`

export const View = styled.View`
        flex:2;
        align-items: center;
        justify-content:center;
        padding-top: 40px;
`

export const ButtonContainer = styled.View`
        flex-direction:row;
        justify-content: space-around;
        align-items:center;
        width:100%;
        padding: 0 10px 10px 10px;
`
